import React  from 'react';
import { NavLink
} from "react-router-dom";

const Header = () => {
    return ( 
    <header className="header">
        <div className="header_logo">
            <NavLink to="/" >
                <img src={ process.env.PUBLIC_URL + '/assets/logo.png' } />
            </NavLink>
        </div>
        <nav className="nav">
            <ul className="nav-list">
                <NavLink to="about"> 
                    <li>About</li>
                </NavLink>
                <NavLink to="team"> 
                    <li>Team</li>
                </NavLink>
                <NavLink to="contact"> 
                    <li>Contact</li>
                </NavLink>
            </ul>
        </nav> 
        </header>

    );
}

export default Header;
